import {CroctProvider} from '@croct/plug-react'

function Inicio(){
  function developer(e){
    e.preventDefaut()
    alert("entrei!");
  }
  return (
    <div id="Page">
      <div id="titulo">
        <h1>Seja bem-vindo a Croct!</h1> 
      </div>
      <div id="introdution">
        <p>Dentre as opções abaixo, qual você mais se identifica?</p>
        <button onClick={developer}>Developer</button>
        <button>Marketing</button>
        <button>Growt-hacker</button>
      </div>
    </div>)
}
function App() {
  return (
    <CroctProvider appId="00000000-0000-0000-0000-000000000000"> 
    <Inicio/>
    </CroctProvider>
  );
}

export default App;
